  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>E-learning</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent>
        <Login />
      </IonContent>
    </IonPage>
  );
};

export default Home;
